import React from "react";

export default function About() {
  return (
    <>
      <h5 className="card-title">About me</h5>
      <p className="card-text">
        Lorem ipsum dolor sit amet, consectetur adipiscing elit Minecraft and
        Fortnite. <br /> In scelerisque quam sit amet sapien accumsan euismod.
        Pellentesque ut justo turpis. <br />
        Aenean egestas ante eu ante accumsan, id fermentum lacus aliquet. <br />
        Sed consectetur sapien. <br /> Vel tellus mollis dapibus. <br /> Fusce
        ac massa quis risus lobortis porta. Donec ut erat diam.
      </p>
    </>
  );
}
